while(True):
    # choice = input("Choose a number \n[0] Exit\n[1] Solve with A*\n[2] Solve with BFS\nChoice: ")
    choice = input("choose:")

    if choice != "1" and choice != "2" and choice != "0":
        print("Wrong Input! Try Again...")

    elif choice == "0":
        print("Goodbyee...")
        exit(0)

